import { createContext } from 'react';
import { AbstractCar } from '../models';

interface CarsContextType {
  car: AbstractCar | undefined;
  isFamilyCar: boolean;
  isSportsCar: boolean;
}

export const CarsContext = createContext<CarsContextType>({
  car: undefined,
  isFamilyCar: false,
  isSportsCar: false
});
